import { GET_BLOGS } from "../../apis/Apis";

const BlogPanel = () => {
  const getBlogs = () => {
    try {
      const res = GET_BLOGS();
      console.log(res);
    } catch (error) {
      console.log(error);
    }
  };
  return <></>;
};
export default BlogPanel;
